import React from "react";
import SettingsIcon from '@mui/icons-material/Settings';
const Header = () => {
  return (
    <>
      <section>
        <div className="container">
          <div className="row">
            <h1>Welcome to Air Care</h1>
            <p>
              For 25 years, Air Care, Heating & Air Conditioning Expert has
              remained a true family owned and operated residential and light
              commercial HVAC company.
            </p>
            <div className="col-lg-3 col-md-3 col-12">
              <div className="card">
                <img src="http://st.ourhtmldemo.com/new/Aircare/images/welcome/1.jpg" alt="" />
                <div>
                    <SettingsIcon/>
                    <p>great Explore of Truth</p>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default Header;
